import * as React from "react";
import "./About.css";
import logo from "../../Images/tillsterlogo.jpeg";
import info from "../../Images/tillster.png";
import taxfyle from "../../Images/tax.png";
import gw from "../../Images/gw.png";
import iphone from "../../Images/iphone.png";

import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
function About() {
  return (
    <div id="experience">
      <h3 className="header">A little about me..</h3>
      <div className="grid">
        <Box
          sx={{
            width: "100%",
            height: 400,
            backgroundColor: "#91be4a",
          }}
        >
          <p className="aboutMeText">
            Ever since I was a little girl in Caracas, Venezuela, I've always
            been obsessed with technology. After learning how to code in high
            school, I set out to pursue a career in software development.{" "}
          </p>
        </Box>

        <div className="textContainer">
          <Box
            sx={{
              width: "70%",
              height: 400,
              margin: "auto",
              backgroundColor: "#ffffff",
              borderRadius: 8,
            }}
          />
        </div>
        <div className="boxContent"></div>
      </div>
    </div>
  );
}
export default About;
